import './Line.css'
import Cell from '../Cell/Cell'

interface LineProps {
    number: number;
}



function Line({ number }: LineProps) {
    return (
        <div>

            <div className='Line'>{number}
            </div>
            <Cell/>
        </div>

    );
};

export default Line;
